#ui=input("enter:")
ui=""
product=[]
for i in range(995):#i==number
    tot=1
    for n in range(0+i,5+i):#n==index
        print(n)
        if int(ui[n])==0:
            tot=0
            break
        else:
            tot*=int(ui[n])
    print(tot)
    product.append(tot)
set_product=set(product)
print("max product:",max(set_product))
